import React, { useState } from "react"
import apiService from "../services/api"

const LogFilter = () => {
   const [startDate, setStartDate] = useState('')
   const [endDate, setEndDate] = useState('')
   const [keyword, setKeyword] = useState('')

   const handleFilter = async () => {
      const formattedStartDate = new Date(startDate).toISOString().split('T')[0]
      const formattedEndDate = new Date(endDate).toISOString().split('T')[0]
      try {
         const logsData = await apiService.filterLogs(formattedStartDate, formattedEndDate, keyword)
         setFilteredLogs(logsData)
      } catch (error) {
         console.error('Error filtering logs:', error)
      }
   }

   return (
      <div className="filters">
         <h2>Filters</h2>
         <input
            type="text"
            placeholder="Start Date (YYYY-MM-DD)"
            value={startDate}
            onChange={(e) => setStartDate(e.target.value)}
         />
         <input
            type="text"
            placeholder="End Date (YYYY-MM-DD)"
            value={endDate}
            onChange={(e) => setEndDate(e.target.value)}
         />
         <input
            type="text"
            placeholder="Search keyword..."
            value={keyword}
            onChange={(e) => setKeyword(e.target.value)}
         />
         <button onClick={handleFilter}>Apply</button>

         <ul>
            {filteredLogs.map((log) => (
               <div key={log._id}>
                  <p><b>ID:</b> {log._id}</p>
                  <p><b>IP:</b> {log.ip_address}</p>
                  <p><b>Date:</b> {log.date}</p>
                  <p><b>Time:</b> {log.time}</p>
                  <p><b>Username:</b> {log.username}</p>
                  <p><b>Version:</b> {log.version}</p>
                  <p><b>Document:</b> {log.document}</p>
                  <p><b>Description:</b> {log.description}</p>
             </div>
            ))}
         </ul>
      </div>
   )
}

export default LogFilter
